function [ eqs, data0, eqs_data ] = problem_p5p_refractive( data0 )
gen = str2func(['gen_problem_p5p_refractive_gj_elim']);

if nargin < 1 || isempty(data0)
    data0 = randi(50,3*(5+5),1);
end
xx = create_vars(5);    

[M,M2,B]=gen(data0, xx);
eqs = M*transpose(B) + M2;

if nargout == 3
    xx = create_vars(5+3*10);
    data = xx(6:end);

    [M,M2,B]=gen(data, xx(1:5));
    eqs_data = M*transpose(B) + M2;

    totalsyms = 5 + 30;
    noofvars = 5;
    ipparams = strcat('a',num2str(1));
    for i = 2:totalsyms
        if i > noofvars
            ipparams = strjoin({ipparams, ',c', num2str(i-noofvars)}, '');
        else
            ipparams = strjoin({ipparams, ',a', num2str(i)}, '');
        end
    end
    
    fileID = fopen('Eqs_problem_p5p_refractive.m','w');
    fprintf(fileID, '%s', strjoin({'function eqs = retrieve_eqs(', ipparams, ') '},''));
    fprintf(fileID, '\n');
    for i = 1:size(eqs,1)
        fprintf(fileID, '%s', strjoin({'eqs(', num2str(i),') = ',char(eqs_data(i,1), true, [], true, noofvars), ';'},''));
        fprintf(fileID, '\n');
    end
    fprintf(fileID, '\n');
    fprintf(fileID, '%s', 'end');
    fclose(fileID);

end
end




